{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/brightuzosike/bellabeat-case-study-capstone-project?scriptVersionId=96398702\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# BELLABEAT CASE STUDY - CAPSTONE PROJECT\n\n## Introduction\nThis case study is carried out for the purpose of identifying key insights into how users leverage smart devices in their daily activities. This will help the company (Bellabeat) make data-driven decisions as to new profitable features in their app. This insights will be delivered using the data analysis process of _**Ask, Prepare, Process, Analyze, Share**_ and _**Act**_.\n\n![Bellabeat Logo](data:image/jpeg;base64,)\n\n### About the company\nUrška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n\nBy 2016, Bellabeat had opened offices around the world and launched multiple products. Bellabeat products became available through a growing number of online retailers in addition to their own e-commerce channel on their website. The company has invested in traditional advertising media, such as radio, out-of-home billboards, print, and television, but focuses on digital marketing extensively. Bellabeat invests year-round in Google Search, maintaining active Facebook and Instagram pages, and consistently engages consumers on Twitter. Additionally, Bellabeat runs video ads on Youtube and display ads on the Google Display Network to support campaigns around key marketing dates.\n\nSršen knows that an analysis of Bellabeat’s available consumer data would reveal more opportunities for growth. She has asked the marketing analytics team to focus on a Bellabeat product and analyze smart device usage data in order to gain insight into how people are already using their smart devices. Then, using this information, she would like high-level recommendations for how these trends can inform Bellabeat marketing strategy.","metadata":{}},{"cell_type":"markdown","source":"## ASK\n\nIt is crucial to know the length and depth of the business task. As can be deduced from the introduction section, the business task is circumvented around trends on how users leverage their smart devices on a daily basis and the opportunistic features that can result from findings. \n\nThis business task can be broken down into three questions to help us solve this technically. These questions are:\n1. What are some trends in smart device usage?\n1. How could these trends apply to Bellabeat customers?\n1. How could these trends help influence Bellabeat marketing strategy?\n\nTo gain insights into trends, the following datasets were provided encapsulated in;\n*Fitabase Data 4.12.16-5.12.16*\n\n### STAKEHOLDERS\n\n* **Urška Sršen**: Bellabeat’s cofounder and Chief Creative Officer\n* **Sando Mur**: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n* **Bellabeat marketing analytics team**: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.","metadata":{}},{"cell_type":"markdown","source":"## PREPARE\n\n### Data Source\n**FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Möbius**\n\n* 18 datasets were generated by respondents to a distributed survey via **Amazon Mechanical Turk** between 03.12.2016-05.12.2016.\n\n* 30 eligible Fitbit users *consented* to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n\n### Limitations\n\nThere's limitation in size (30 users) and not having any demographic information, we could encounter a sampling bias. We are not sure if the sample is representative of the population as a whole. Another problem we would encounter is that the dataset is not current and also the time limitation of the survey (2 months long). That is why we will give our case study an operational approach.\n\nIn light of these limitations, I'll proceed with the sample set suggested to gain high level insights.","metadata":{}},{"cell_type":"markdown","source":"### Importing Datasets\n\nBefore importing these datasets, I'll load the packages to be used in this case study in compliance with the data analysis process.","metadata":{}},{"cell_type":"code","source":"## Loading Libraries \n\nlibrary(tidyverse)\nlibrary(ggplot2)\nlibrary(lubridate)\nlibrary(janitor)\ninstall.packages('dplyr')\nlibrary(dplyr)\nlibrary(skimr)\ninstall.packages('SimDesign')\nlibrary(SimDesign)","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:31:09.366947Z","iopub.execute_input":"2022-05-23T21:31:09.36916Z","iopub.status.idle":"2022-05-23T21:31:28.741624Z"},"trusted":true},"execution_count":18,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nWarning message in install.packages(\"dplyr\"):\n“installation of package ‘dplyr’ had non-zero exit status”\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"As can be noticed, most of the above packages already comes with the tidyverse package and was loaded directly from it. \n\nWith these packages at my disposal, I can go ahead and import these datasets using the `read_csv()` function that comes with the *readr* package of tidyverse.\n\nI'll be focusing analysis on the daily datasets because they are the most probable to highlight significant and important trends.","metadata":{}},{"cell_type":"code","source":"# Importing datasets\n\ndailyActivity_df <- read_csv('../input/fitabase-data-4-12-165-12-16/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv')\nasleepDay_df <- read_csv('../input/fitabase-data-4-12-165-12-16/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv')\nweight_df <- read_csv('../input/fitabase-data-4-12-165-12-16/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv')","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:31:28.746361Z","iopub.execute_input":"2022-05-23T21:31:28.74934Z","iopub.status.idle":"2022-05-23T21:31:29.091979Z"},"trusted":true},"execution_count":19,"outputs":[{"name":"stderr","text":"\u001b[1mRows: \u001b[22m\u001b[34m940\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m15\u001b[39m\n\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n\u001b[1mDelimiter:\u001b[22m \",\"\n\u001b[31mchr\u001b[39m  (1): ActivityDate\n\u001b[32mdbl\u001b[39m (14): Id, TotalSteps, TotalDistance, TrackerDistance, LoggedActivitiesDi...\n\n\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n\u001b[36mℹ\u001b[39m Specify the column types or set `show_col_types = FALSE` to quiet this message.\n\u001b[1mRows: \u001b[22m\u001b[34m413\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m5\u001b[39m\n\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n\u001b[1mDelimiter:\u001b[22m \",\"\n\u001b[31mchr