rify result\nprint('Duplicate records in cleanActivity_df')\nsum(duplicated(cleanActivity_df))\n\n# Verify Number of Participants\nprint('Number of Distinct Participants')\nn_distinct(cleanActivity_df$Id)","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:31:30.663433Z","iopub.execute_input":"2022-05-23T21:31:30.665048Z","iopub.status.idle":"2022-05-23T21:31:30.930788Z"},"trusted":true},"execution_count":28,"outputs":[{"name":"stdout","text":"[1] \"Duplicate records in sleep_weight\"\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"583","text/markdown":"583","text/latex":"583","text/plain":"[1] 583"},"metadata":{}},{"name":"stdout","text":"[1] \"New check: Duplicate records in sleep_weight_clean\"\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"0","text/markdown":"0","text/latex":"0","text/plain":"[1] 0"},"metadata":{}},{"name":"stdout","text":"[1] \"Merge Result: dailyActivity_df & sleep_weight_clean\"\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 6 × 18</caption>\n<thead>\n\t<tr><th></th><th scope=col>Id</th><th scope=col>ActivityDate</th><th scope=col>TotalSteps</th><th scope=col>TotalDistance</th><th scope=col>TrackerDistance</th><th scope=col>LoggedActivitiesDistance</th><th scope=col>VeryActiveDistance</th><th scope=col>ModeratelyActiveDistance</th><th scope=col>LightActiveDistance</th><th scope=col>SedentaryActiveDistance</th><th scope=col>VeryActiveMinutes</th><th scope=col>FairlyActiveMinutes</th><th scope=col>LightlyActiveMinutes</th><th scope=col>SedentaryMinutes</th><th scope=col>Calories</th><th scope=col>TotalMinutesAsleep</th><th scope=col>TotalTimeInBed</th><th scope=col>WeightKg</th></tr>\n\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;