eps of **10,000** from Centers for Disease Control and Prevention (CDC). Invariably, users burn as much amount of calories when taking their 8000th - 10000th step as they would when taking their 16000th - 20000th step.","metadata":{}},{"cell_type":"markdown","source":"I want to go a bit further and group users based on their activity and generate insights from these new grouping. ","metadata":{}},{"cell_type":"code","source":"# Create new dataframe for Usertypes\n\nactivity_by_usertype <- finalActivity_df %>% group_by(Id) %>%\nsummarise(\nuser_type = factor(case_when(\n    SedentaryMinutes > mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Sedentary\",\n    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes > mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Lightly Active\",\n    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes > mean(FairlyActiveMinutes) & VeryActiveMinutes < mean(VeryActiveMinutes) ~ \"Fairly Active\",\n    SedentaryMinutes < mean(SedentaryMinutes) & LightlyActiveMinutes < mean(LightlyActiveMinutes) & FairlyActiveMinutes < mean(FairlyActiveMinutes) & VeryActiveMinutes > mean(VeryActiveMinutes) ~ \"Very Active\",\n),levels=c(\"Sedentary\", \"Fairly Active\", \"Lightly Active\", \"Very Active\")), TotalSteps, TotalDistance,Calories, WeightKg) %>%\ndrop_na()\n\n# Plot TotalSteps by user_type\nggplot(activity_by_usertype, aes(user_type, TotalSteps, fill=user_type)) +\n    geom_boxplot() +\n    labs(title=\"TotalSteps by User type\", x=NULL) +\n    theme(legend.position=\"none\", text = element_text(size = 20),plot.title = element_text(hjust = 0.5))\n\n# Plot Calories by user_type\nggplot(activity_by_usertype, aes(user_type, Calories, fill=user_type)) +\n    geom_boxplot() +\n    labs(title=\"Calories burned by User type\", x=NULL) +\n    theme(legend.position=\"none\", text = element_text(size = 20),plot.title = element_text(hjust = 0.5))\n\n# Plot TotalDistance by user_type\nggplot(activity_by_usertype, aes(user_type, TotalDistance, fill=user_type)) +\n    geom_boxplot() +\n    labs(title=\"TotalDistance by User type\", x=NULL) +\n    theme(legend.position=\"none\", text = element_text(size = 20),plot.title = element_text(hjust = 0.5))\n\n# Create new column for avg_weight by user_type\nweight_by_usertype <- activity_by_usertype %>% group_by(user_type) %>% mutate(avg_weight = mean(WeightKg))\n\n# Plot Average weight by user_type \nggplot(weight_by_usertype, aes(user_type, avg_weight, fill=user_type)) +\n    geom_count() +\n    labs(title=\"Average Weight by User type\", x=NULL) +\n    theme(legend.position=\"none\", text = element_text(size = 20),plot.title = element_text(hjust = 0.5))","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:31:32.852969Z","iopub.execute_input":"2022-05-23T21:31:32.855158Z","iopub.status.idle":"2022-05-23T21:31:33.898603Z"},"trusted":true},"execution_count":31,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'Id'. You can override using the `.groups`\nargument.\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT9f/H8fclaZou2tLSsvfeoKIIIiAqS0UQUBEVUL4/FAeK4sa9BQfiBAUH\nooCsAjIElSUgU5bsvTvoHsn9/kgbQpumSZo2yfX5+OP7vd59cnnncuZe3Ph8FFVVBQAAAIFP\n5+sCAAAA4B0EOwAAAI0g2AEAAGgEwQ4AAEAjCHYAAAAaQbADAADQCIIdAACARhh8XQCAAHbs\nn8Uz5i1ft379jn3HkpISU9JzQ8PCo+JqNG3avOP1PXr3G3h1g0hf1wgAFQhn7AAHMi/MUbzB\n15/DExePvGCrf1FSVnHNzmyceds19Wtf2XvcaxPmLlt74PCxxJR0c15OakrisX07li2Y+erY\nBzs2ir36ttHrjqeXZ/2BaGh8uHWDNx+1zte1FGvNsKa2HePTU258pwvbxdteuC41p+wqBCAE\nOwAeWPnOPXWuuWv+34ecN1PVvA3zP72uQcN3lxwul7oAoKLjUiwA9+z4/L7uz/xg+9MU0+TO\n++7qdu1VDWrERQRLcnLykb3b1v2x5MdZv6f