e recommended hours for adults between 18 & 60 is 7+ hours ([Recommended sleep hours](https://www.cdc.gov/sleep/about_sleep/how_much_sleep.html))\n* The very active group have between 300 - 500 minutes (5-8 hours) of sleep.\n* The sedentary, fairly active and lightly active groups mostly have between 250 - 550 minutes of sleep (4-9 hours). One can quickly identify a higher probability of these ones oversleeping or undersleeping especially as they would likely have a job (when associated with bellebeat customers).\n\nSo how about finding out how long it takes for these different user groups to fall asleep when they get into bed:","metadata":{}},{"cell_type":"code","source":"# Create new column TimeToFallAsleep\n\nsleep_time <- sleep_by_usertype %>% mutate(TimeToFallAsleep = TotalTimeInBed - TotalMinutesAsleep) %>% drop_na()\n\n# Plot TimeToFallAsleep by user_type\nggplot(sleep_time, aes(user_type, TimeToFallAsleep, fill=user_type)) +\n    geom_boxplot() +\n    labs(title=\"TimeToFallAsleep by User type\", x = NULL) +\n    theme(legend.position=\"none\", text = element_text(size = 20),plot.title = element_text(hjust = 0.5))","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:31:34.588292Z","iopub.execute_input":"2022-05-23T21:31:34.590506Z","iopub.status.idle":"2022-05-23T21:31:34.849003Z"},"trusted":true},"execution_count":33,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2AT5R/H8eeSpkn3oEDZFJC9BEGRoSgi86eyEUHAgSCiDAciQxFRFFEEBRUU\nRUVk7z0FZMjeGym7LbS06Upyvz9C09AmaZOmTXp9v/4Kd0/uvsk9XD698Zwky7IAAABA4afy\ndAEAAABwD4IdAACAQhDsAAAAFIJgBwAAoBAEOwAAAIUg2AEAACgEwQ4AAEAhCHYAAAAKQbDD\nPcmxiyR3sCww9kRny8SLqUYPfjTXuP0LcZcbuzu4XEyLOWfcW0zCpQ8sC191OyWXs+yRjfFR\nfhrrgideTHBvwdm5UKdS9S4ZaP4eag7c5ela7NrRr7ple02/lpT7N654sKTljbvupuVfhYBn\nEewAeIub+4ZdTDFYT/npg32eKgYACiOCHQBvsXrYqixTLi0dlsZTDwEg13w8XQC8hTbo4QUL\nFtibe23L6DemnTC/fvirn94uG1RQdXlMofhC6rzz7djGJXLfPuKhUvlXTB4ZUy8P