 dataset present itself.","metadata":{}},{"cell_type":"markdown","source":"### Recommendations\n1. So many new features can result from Bellabeat integrating the **step per mile** algorithm into their app. Some of which can help users who want to shed some weight. Reducing user's daily recommended step/mile can greatly increase the amount of calories they burn and result in weight loss.\n1. Also, the a careful track of the parameters of the fairly active users can be of benefit in helping those who want to maintain a fixed weight, something that's rare in most smart devices. Centering a marketing strategy around this would really be profitable to Bellabeat.\n1. A feature that can track and reduce the average time users take to fall asleep can be of immense help to prevent bad sleeping patterns and habits like insomnia. A sound marketing strategy should also be centered around this targeting users who experience situations liable to cause depression, anxieties and stress. ","metadata":{}},{"cell_type":"markdown","source":"### Further Analysis\nThe limitations of this dataset can be summarized using the `bias()` function:","metadata":{}},{"cell_type":"code","source":"# Checking Distribution Bias\nbias(finalActivity_df$TotalSteps, rep(10000,16384))\nbias(finalActivity_df$TotalDistance, rep(5,16384))","metadata":{"execution":{"iopub.status.busy":"2022-05-23T21:31:34.852709Z","iopub.execute_input":"2022-05-23T21:31:34.854298Z","iopub.status.idle":"2022-05-23T21:31:34.875861Z"},"trusted":true},"execution_count":34,"outputs":[{"output_type":"display_data","data":{"text/html":"-698.470703125","text/markdown":"-698.470703125","text/latex":"-698.470703125","text/plain":"[1] -698.4707"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"1.28463258228999","text/markdown":"1.28463258228999","text/latex":"1.28463258228999","text/plain":"[1] 1.284633"},"metadata":{}}]},{"cell_type":"markdown","source":"The distribution of this dataset is highly skewed due to a small sample size of 33 participants. The distribution is positively skewed as a result of more sedentary users participating incomparison to other groups and negatively skewed due to high values in daily total steps from very active users in a small sample. Therefore to checkmate distribution bias;\n\n1. A larger dataset in which all groups are represented equally would be helpful to reevaluate this analysis to ensure sampling bias is eliminated. This dataset should also contain detailed demographics of users.\n1. A detailed dataset on the lifestyle of fairly active users to confirm or dispute insights from this analysis.","metadata":{}},{"cell_type":"markdown","source":"![Thank you](data:image/jpeg;base64,)","metadata":{}},{"cell_type":"markdown","source":"Thank You for examining my case study. I would love recommendations on improvement in the comments.","metadata":{}}]}